import React from "react";
import "./PropertyCard.css";

const PropertyCard = ({ project }) => {
  const address = project.addresses?.[0]?.fullAddress || "N/A";
  const status = project.status || "N/A";
  const name = project.projectSummary || "Unnamed Project";

  const firstProperty = project.properties?.[0];
  const price = firstProperty?.specs?.price
    ? `‚Çπ${Number(firstProperty.specs.price).toLocaleString()}`
    : "N/A";

  const bhk = firstProperty?.customBHK || "BHK";

  return (
    <div className="property-card">
      <div className="property-info">
        <h3>{name}</h3>
        <p>
          üìç <strong>{address}</strong>
        </p>
        <p>
          üè† {bhk} | üí∞ {price}
        </p>
        <p>üìÖ Status: {status}</p>
      </div>
    </div>
  );
};

export default PropertyCard;
